// App.js
import React from 'react';
import { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import SearchTools from './pages/SearchTools';
import Home from './pages/Home';
import About from './pages/About';
import Contact from './pages/Contact';
import Login from './pages/Login';
import Register from './pages/Register';
import './App.css';
import { getAuthToken, request, setAuthHeader } from './helpers/axios_helper';

function App() {



  // const [componentToShow, setComponentToShow] = useState('welcome');

  const logout = () => {
    setAuthHeader(null);
  };

  const onLogin = async (e, username, password) => {
    e.preventDefault();
    request(
      "POST",
      "/login",
      {
          username: username,
          password: password
      }).then(
      (response) => {
          setAuthHeader(response.data.token);
          this.setState({componentToShow: "messages"});
      }).catch(
      (error) => {
          setAuthHeader(null);
          this.setState({componentToShow: "welcome"})
      }
  );
  };

  const onRegister = async (event, dni, nombre, direccion, email, telefono, username, password) => {
    event.preventDefault();
    try {
      const response = await request('POST', '/register', {
        dni: dni,
        nombre: nombre,
        direccion: direccion,
        email: email,
        telefono: telefono,
        username: username,
        password: password,
      });
      setAuthHeader(response.data.token);
      console.log(response.data);
      // setComponentToShow('messages');
      if (!response.ok) {
        throw new Error('Registration failed!');
      }
      console.log('Registration successful!', response);
      // Handle successful registration (e.g., clear form, show success message)

    } catch (error) {
      setAuthHeader(null);
      // setComponentToShow('welcome');
      console.error('Registration error:', error);
      // Handle registration errors (e.g., display error message to user)

    }
  };


  return (
    <Router>
      <div className="app">
        <nav className="navbar">
          <div className="container">
            <h1 className="logo">DIY4Rent</h1>
            <ul className="menu">
              <li className="menu-item">
                <Link to="/">Home</Link>
              </li>
              <li className="menu-item">
                <Link to="/search">Search Tools</Link>
              </li>
              <li className="menu-item">
                <Link to="/about">About</Link>
              </li>
              <li className="menu-item">
                <Link to="/contact">Contact</Link>
              </li>
              {getAuthToken() === null &&
                <li className="menu-item">
                  <Link to="/login">Iniciar sesión</Link>
                </li>
              }
              {getAuthToken() === null &&
                <li className="menu-item">
                  <Link to="/register">Registrarse</Link>
                </li>
              }
              {getAuthToken() !== null &&
                <li className="menu-item">
                  <button className="logout" onClick={logout}>Cerrar sesión</button>
                </li>
              }


            </ul>
          </div>
        </nav>
        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/search" element={<SearchTools />} />
            <Route path="/login" element={<Login onLogin={onLogin} />} />
            <Route path="/register" element={<Register onRegister={onRegister} />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
